import wiki from 'wikijs'
 const translate = require('google-translate-api');


 const wikiped = (data)=>{


translate('Ik spreek Engels', {to: 'en'}).then(res => {
    console.log(res.text);
    //=> I speak English
    console.log(res.from.language.iso);
    //=> nl
}).catch(err => {
    console.error(err);
});
   }


export default wikiped
